import React from 'react';

const styles = {
  duoImage: {width: '220px',
             height: '200px'}
}

const image1 = () => (<img src='boxA.gif' onClick={imageHandler} style={styles.duoImage}></img>);
const image2 = () => (<img src='boxB.gif' onClick={imageHandler} style={styles.duoImage}></img>);

const imageHandler = (e) => {e.target.src = (e.target.src.includes('boxA.gif') ? 'boxB.gif' : 'boxA.gif');}

const GeneralPractice18 = () => (
  <div>
    {image1}
    {image2}
  </div>
);

export default GeneralPractice18;
